Urbem\CoreBundle\Entity\Imobiliario\VwMatriculaImovelAtualView:
    type: entity
    table: imobiliario.vw_matricula_imovel_atual
    id:
        inscricaoMunicipal:
            type: integer
            generator:
                strategy: NONE
            column: inscricao_municipal
    fields:
        timestamp:
            type: datetime
            nullable: true
        matRegistroImovel:
            type: string
            nullable: true
            length: 10
            column: mat_registro_imovel
        zona:
            type: string
            nullable: true
            length: 10
